export async function loadContributors() {
  const url = "https://api.github.com/search/repositories?q=stars:>100000";
  const url2 = "https://api.github.com/users/gemmas95/repos";

  // Meanwhile I can't get the data I work with other, below there is what I got
  const repoName = "OnSport";
  const url3 = `https://api.github.com/search/repositories?q=name:${repoName}`;

  const owner = "jxw1102";
  const repo = "Projet-merou";
  const url4 = `https://api.github.com/repos/${owner}/${repo}/contributors`;
  // API call
  const response = await fetch(url4);
  const contributors = await response.json();
  console.log("contributors...", contributors);
  return contributors.items;
}
